import react from 'react'
import books from '../assets/data'
import ListItem from '../components/ListItem'

const BooksList = () => {
    return(
        <ul className="the-list">
            {books.map((book, index) => (
                <li ><ListItem key={index} book={book}  /></li>
            ))}
        </ul>
    )
}

export default BooksList;
